import React, { Component } from 'react';
import BasePageWithCard from './BasePageWithCard.js';
import EditThemeListTeacherForm from '../components/Tables/EditThemeList/EditThemeListTeacherForm.js';

const ThemesCard = ({ tableData, name }) => {
    
    return (
        <BasePageWithCard isAuthenticated={true}>
          <EditThemeListTeacherForm tableData={tableData}/>
          </BasePageWithCard>
      );
    

}
export default ThemesCard;
